function Dashboard() {
    return (
        <main>
            <div className='row'>
                <div className='col-sm-12 col-md-12 col-lg-12'>
                    <div className='card'>
                        <div className='card-header'>
                            <h3><span className='fa fa fa-tachometer'></span>&nbsp;Informaci√≥n General</h3>
                        </div>
                        <div className='card-body'>
