                                <div className='col-lg-4'>
                                    <TrabajosCurso/>
                                </div>
                                <div className='col-lg-4'>
                                    <TrabajosEspera/>
                                </div>
                                <div className='col-lg-4'>

                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </main>
    );

}

export default Dashboard;
